import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import "./App.css"

let Femoji = ['ðŸ˜¸', 'ðŸ˜†', 'ðŸ˜„', 'ðŸ¤—', 'ðŸ¤«', 'ðŸ™‰', 'ðŸ¤­']
let rand = Math.floor(Math.random() * 7)
let nand = Math.floor(Math.random() * 7)
let pand = Math.floor(Math.random() * 7)
let first = Femoji[rand]
let second = Femoji[nand]
let third = Femoji[pand]


ReactDOM.render(
  <>
    <div className="container">
      <div className="rolMachine">
        <App x={first} y={second} z={third} />

      </div>
    </div>


  </>, document.getElementById('root')
);
